import React from 'react';

const CustomerService = () => {
  return (
    <div>
      <h2>Customer Service</h2>
      <h3>Developer Profile</h3>
      <p>Developer: John Doe</p>
      <p>Email: johndoe@realestate.com</p>
      <p>Contact: +1 234 567 890</p>
    </div>
  );
};

export default CustomerService;
